client = commands.Bot(command_prefix = ".")
client.remove_command('help')


@client.event
async def on_ready():
    await client.change_presence(activity=discord.Game(".yardım"))

@client.command()
async def malpp(ctx, user: discord.Member = None):
    if user == None:
        user = ctx.author

    pp = Image.open("malp.jpg")

    asset = user.avatar_url_as(size = 256)
    data = BytesIO(await asset.read())
    pfp = Image.open(data)
    pfp = pfp.resize((344,344))

    pp.paste(pfp, (42,28))

    pp.save("malpup.png")

    await ctx.send(file = discord.File("malpup.png"))

@client.command()
async def pp(ctx, user: discord.Member = None):
    if user == None:
        user = ctx.author

    pp = Image.open("pp.jpg")

    asset = user.avatar_url_as(size = 512)
    gpp= ctx.guild.icon_url_as(size=128)
    data = BytesIO(await asset.read())
    data2 = BytesIO(await gpp.read())
    pfp = Image.open(data)
    gpfp = Image.open(data2)
    pfp = pfp.resize((430,430))
    gpfp = gpfp.resize((184,184))


    pfp = pfp.convert("RGBA")
    gpfp = gpfp.convert("RGBA")
    pp.paste(pfp, (1000,210), pfp)
    pp.paste(gpfp, (1407,1007), gpfp)

    pp.save("foto.png")

    await ctx.send(file = discord.File("foto.png"))

